!function(){var e=document.querySelector(".getLinks"),t=document.querySelector(".urlInput");e.onclick=(()=>{var e=document.querySelector("#output");e.innerHTML="Loading the video...",fetch(`https://ripsave.com/download?video=${t.value}`).then(e=>e.text()).then(t=>{e.innerHTML=t,document.querySelectorAll(".download .table a").forEach(e=>{e.classList.contains("btn-success")||e.classList.add("btn-success")})}).catch(e=>console.log(e.message))})}();
